import React, { Component } from 'react'
import "./css/styles.css";
import "./css/w3schools.css";

export default class Sidebar extends Component {
  render() {
    return (
      <div>
      <div class="sidenav georgia">
        <img src="senior_portrait_square.JPG" alt="portrait" class="img" width="200" height="200"/>
        <h2>Caroline Abel</h2>
        <a href="#">About Me</a>
        <a href="#">Education</a>
        <a href="#">Projects</a>
        <a href="#">Contact Me</a>
      </div>
      </div>
    )
  }
}
